import './style.css'
import {
  faPlusSquare,
  faSave,
  faTrashAlt
} from '@fortawesome/pro-regular-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { yupResolver } from '@hookform/resolvers/yup'
import React from 'react'
import { render } from 'react-dom'
import { useFieldArray, useForm } from 'react-hook-form'
import * as yup from 'yup'
import { DEFAULT_VALUES } from './constants'
import { VoV4Options } from './models/options'
import { existsTabGroups, isV4Options } from './utils'

const schema = yup.object().shape({
  upperLimitOfTheTab: yup.number().required(),
  behaviorWhenANotificationClicks: yup.string().required(),
  useNotification: yup.boolean(),
  useGroupTab: yup.boolean(),
  restoreWithBlankPage: yup.boolean(),
  tabGroupName: yup.string().when('useGroupTab', {
    is: true,
    then: yup.string().required(),
    otherwise: yup.string()
  }),
  tabGroupColor: yup.string(),
  urlToCloseWithPriority: yup.array().of(
    yup.object().shape({
      value: yup.string().url()
    })
  )
})

const Form = ({
  options
}: {
  options: VoV4Options['v4']['options']
}): React.ReactElement => {
  const { control, errors, getValues, handleSubmit, register, reset } = useForm<
    VoV4Options['v4']['options']
  >({
    resolver: yupResolver(schema),
    defaultValues: options
  })

  const { append, fields, remove } = useFieldArray({
    control,
    name: 'urlToCloseWithPriority'
  })

  const [errorMessage, setErrorMessage] = React.useState<string | undefined>()
  const [message, setMessage] = React.useState<string | undefined>()

  return (
    <form
      className="space-y-2"
      onSubmit={handleSubmit((values) => {
        chrome.storage.sync.set(
          {
            v4: {
              options: {
                ...DEFAULT_VALUES,
                ...values,
                upperLimitOfTheTab: parseInt(String(values.upperLimitOfTheTab))
              }
            }
          },
          () => {
            if (typeof chrome.runtime.lastError?.message === 'string') {
              setErrorMessage(chrome.runtime.lastError?.message)
              setTimeout(() => {
                setErrorMessage(undefined)
              }, 5000)
              return
            }

            setMessage(chrome.i18n.getMessage('formMessage__saved'))
            setTimeout(() => {
              setMessage(undefined)
            }, 5000)
          }
        )
      })}>
      <div>
        <label className="mr-2" htmlFor="upperLimitOfTheTab">
          {chrome.i18n.getMessage('formLabel__upperLimitOfTheTab')}
        </label>
        <input
          ref={register}
          className="border rounded px-2 py-1 w-16"
          id="upperLimitOfTheTab"
          type="number"
          name="upperLimitOfTheTab"
        />
      </div>
      <div>
        <label className="mr-2" htmlFor="useNotification">
          {chrome.i18n.getMessage('formLabel__useNotification')}
        </label>
        <input
          ref={register}
          className="border rounded p-1"
          id="useNotification"
          type="checkbox"
          name="useNotification"
        />
      </div>
      <div className="ml-4">
        <label className="mr-2" htmlFor="behaviorWhenANotificationClicks">
          {chrome.i18n.getMessage('formLabel__behaviorWhenANotificationClicks')}
        </label>
        <select
          ref={register}
          className="border rounded px-2 py-1"
          id="behaviorWhenANotificationClicks"
          name="behaviorWhenANotificationClicks">
          <option value="reopen">Reopen</option>
          <option value="doNothing">Do Nothing</option>
        </select>
      </div>
      <div className="ml-4">
        <label className="mr-2" htmlFor="restoreWithBlankPage">
          {chrome.i18n.getMessage('formLabel__restoreWithBlankPage')}
        </label>
        <input
          ref={register}
          className="border rounded p-1"
          id="restoreWithBlankPage"
          name="restoreWithBlankPage"
          type="checkbox"
        />
      </div>
      <div>
        <div>
          <label className="mr-2" htmlFor="useGroupTab">
            {chrome.i18n.getMessage('formLabel__useGroupTab')}
          </label>
          {existsTabGroups() ? (
            <input
              ref={register}
              className="border rounded p-1"
              id="useGroupTab"
              type="checkbox"
              name="useGroupTab"
            />
          ) : (
            <input
              readOnly
              checked={false}
              className="border rounded p-1 opacity-50"
              id="useGroupTab"
              type="checkbox"
              name="useGroupTab"
            />
          )}
        </div>
        <div>
          {!existsTabGroups() && (
            <span className="text-red-500">
              Not yet available for your version of Chrome
            </span>
          )}
        </div>
      </div>
      <div className="ml-4">
        <div>
          <label className="mr-2" htmlFor="tabGroupName">
            {chrome.i18n.getMessage('formLabel__tabGroupName')}
          </label>
          <input
            ref={register}
            className="border rounded px-2 py-1"
            aria-invalid={
              String(typeof errors.tabGroupName?.message === 'string') as
                | 'true'
                | 'false'
            }
            id="tabGroupName"
            name="tabGroupName"
          />
        </div>
        <div>
          <span className="text-red-500">{errors.tabGroupName?.message}</span>
        </div>
      </div>
      <div className="ml-4">
        <label className="mr-2" htmlFor="tabGroupColor">
          {chrome.i18n.getMessage('formLabel__tabGroupColor')}
        </label>
        <select
          ref={register}
          className="border rounded px-2 py-1"
          id="tabGroupColor"
          name="tabGroupColor">
          <option value="gray">Gray</option>
          <option value="blue">Blue</option>
          <option value="red">Red</option>
          <option value="yellow">Yellow</option>
          <option value="green">Green</option>
          <option value="pink">Pink</option>
          <option value="purple">Purple</option>
          <option value="cyan">Cyan</option>
        </select>
      </div>
      <div>
        <label className="mr-4" htmlFor="urlToCloseWithPriority">
          {chrome.i18n.getMessage('formLabel__urlToCloseWithPriority')}
        </label>
        <div className="space-y-1 mt-4 ml-4">
          <ul className="space-y-2">
            {fields.map((item, index) => (
              <li
                key={index}
                className="space-y-1 flex flex-col justify-center">
                <div className="space-x-1">
                  <input
                    className="border rounded px-2 py-1 w-2/3"
                    name={`urlToCloseWithPriority[${index}].value`}
                    aria-invalid={
                      String(
                        typeof errors.urlToCloseWithPriority?.[index]?.value
                          ?.message === 'string'
                      ) as 'true' | 'false'
                    }
                    ref={register()}
                    defaultValue={item.value}
                  />
                  <button
                    title="Delete"
                    type="button"
                    className="duration-100 hover:text-blue-500"
                    onClick={() => remove(index)}>
                    <FontAwesomeIcon icon={faTrashAlt} />
                  </button>
                </div>
                <div>
                  <span className="text-red-500">
                    {errors.urlToCloseWithPriority?.[index]?.value?.message}
                  </span>
                </div>
              </li>
            ))}
          </ul>
          <button
            title="Add URL"
            type="button"
            className="text-xl duration-100 hover:text-blue-500"
            onClick={() => {
              if (
                !(getValues().urlToCloseWithPriority ?? [])
                  .map(({ value }) => value)
                  .includes('https://')
              ) {
                append({ value: 'https://' })
              }
            }}>
            <FontAwesomeIcon icon={faPlusSquare} />
          </button>
        </div>

        <div className="flex justify-between items-start mt-4">
          <button
            type="button"
            title="Save"
            className="flex-none border border-gray-400 rounded px-2 py-1 duration-100 hover:bg-gray-400"
            onClick={() => reset()}>
            {chrome.i18n.getMessage('formLabel__reset')}
          </button>
          <div className="flex flex-col items-end">
            <button
              type="submit"
              title="Save"
              className="space-x-1 border rounded px-2 py-1  border-green-400 bg-green-200 duration-100 hover:bg-green-400">
              <FontAwesomeIcon icon={faSave} />
              <span>{chrome.i18n.getMessage('formLabel__save')}</span>
            </button>
            {typeof errorMessage === 'string' ? (
              <span className="text-red-500">{errorMessage}</span>
            ) : null}
            {typeof message === 'string' ? (
              <span className="text-green-500">{message}</span>
            ) : null}
          </div>
        </div>
      </div>
    </form>
  )
}

const OptionsPage = (): React.ReactElement => {
  const [options, setOptions] = React.useState<VoV4Options['v4']['options']>()

  React.useEffect(() => {
    chrome.storage.sync.get(null, (data) => {
      if (isV4Options(data)) {
        setOptions({ ...DEFAULT_VALUES, ...data.v4.options })
      }
    })
  }, [])

  return (
    <div className="p-2">
      <h1 className="text-lg font-bold mb-2">Options</h1>
      {options !== undefined && <Form options={options} />}
      <div className="mt-2 text-xs flex justify-end space-x-1">
        <span>Created by</span>
        <img
          className="w-4 h-4"
          src="data:image/webp;base64,"
        />{' '}
        <a
          href="https://github.com/nju33"
          target="_blank"
          rel="noopener noreferrer"
          className="underline hover:text-yellow-500 duration-100">
          nju33
        </a>
      </div>
      <div className="mt-2 text-xs flex justify-end space-x-1">
        <a href="https://www.buymeacoffee.com/nju33" target="_blank">
          <img
            src="https://cdn.buymeacoffee.com/buttons/v2/default-yellow.png"
            alt="Buy Me A Coffee"
            style={{
              height: 60 / 1.85,
              width: 217 / 1.85
            }}
          />
        </a>
      </div>
    </div>
  )
}

render(<OptionsPage />, document.getElementById('app'))
